import { useState } from "react";

function App() {

  const [todos, setTodos] = useState(["todo 1", "todo 2"])

  return (
    <div className="App">
      <div>
        <input placeholder="What should be done?"/>
        <button>Add</button>
      </div>
      <div>
        {todos.map(todo => (
          <p>{todo}</p>
        ))}
      </div>
    </div>
  );
}

export default App;
